import styled from "styled-components";


export const StyledMainPageOng = styled.div`
    padding: 3rem 6rem;
    display: flex;
    flex-direction: column;
    gap: 2rem;
    align-items: center;
`

export const StyledTextPageOng = styled.div`
    display: flex;
    flex-direction: column;
    gap: 2rem;

    p{
        line-height: 2;
    }
    
`
